import React from 'react';

class TrinketDisplay extends React.Component {
    info = this.props.info;

    displayItem = () => {
        if (this.info) {
            return (
                <div>
                    <h1>{this.info.name}</h1>
                    <h3>{this.info.role}</h3>
                    <h3>Source: {this.info.source}</h3>
                    <h3>Boss: {this.info.boss}</h3>
                    <h3>Views: {this.info.views}</h3>
                </div>
            )
        }
        else {
            return (
                <div>Loading...</div>
            )
        }
    }

    render() {
        return (
            <div>{this.displayItem()}</div>
        )
    }

};

export default TrinketDisplay;
